import React, { Component } from 'react';
import './component.css'

class Login extends Component {
    render(){
        return(
            <header className='login'>
                <div><h2>Log in</h2></div>
                <form>
                <label>Email address</label>
                <input type="email"/>
                <div>2</div>
                </form>

            </header>
        );
    }
}

export default Login;
